import React from 'react'
import {Label, Pie, PieChart, Tooltip,Title } from 'recharts'


function Genderchart() {
   
  {
  
    const data = {
      labels: [
        'Red',
        'Blue',
        'Yellow'
      ],
      datasets: [{
        label: 'My First Dataset',
        data: [10, 5, 10],
        backgroundColor: [
          'rgb(255, 99, 132)',
          'rgb(54, 162, 235)',
          'rgb(255, 205, 86)'
        ],
        hoverOffset: 4
      }]
    };
     return(
      <div className='chart'>
    <center><h1 id="h">Genderchart</h1></center>
    <div>
    <center><PieChart width={400} height={500}id='piechart' >
  <Pie 
    dataKey="value"
    data={data} 
    innerRadius={110}
    outerRadius={170}
    fill='orange'
    />
    </PieChart></center></div>
      </div>
      
    )
   
  }
}


export default Genderchart
